import React from "react";
import "./searchResults.css"
import "./singleSeachResult"
import { OneSearchResult } from "./singleSeachResult";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

export const SearchResults = ({ results, deleteTrack, editTrack }) => {
    return (
        <div className="results">
        <Container className="search-results">
            <Row xs={1} md={2} lg={3} xl={3} xxl={4} className="g-4">{results.map((result, id) => {      
                return <Col><OneSearchResult 
                            result={result} 
                            key={id} 
                            id={result._id} 
                            deleteTrack={deleteTrack}
                            editTrack={editTrack}/> 
                </Col>
            })}</Row>
        </Container>
        </div>
    )
}
